using System;

public static class Snippet
{
	public static void func(ref Microsoft.Web.WebView2.WinForms.WebView2 brws, System.String url)
	{

		var uri = new Uri(url);
		brws.Source = uri;	
		brws.CoreWebView2.Settings.AreDefaultContextMenusEnabled = false;

	}

}

using System;

public static class Snippet
{
	public static void func(ref Microsoft.Web.WebView2.WinForms.WebView2 brws)
	{

		brws.CoreWebView2.Settings.AreDefaultContextMenusEnabled = false;
		brws.CoreWebView2.Settings.AreDevToolsEnabled = false;
	}

}

using System;
using System.Threading.Tasks;
using System.Windows.Threading;

public static class Snippet
{
	public static System.String func(ref Microsoft.Web.WebView2.WinForms.WebView2 brws)
	{

		string sHtml = CustomWait(brws.ExecuteScriptAsync("document.documentElement.innerHTML"));
		return System.Text.RegularExpressions.Regex.Unescape(sHtml);
	}

	private static string CustomWait(Task<string> task)
    {
    	System.Timers.Timer timer = new System.Timers.Timer();
        DispatcherFrame frame = new DispatcherFrame(); 

        string wait = "Empty";

        task.ContinueWith(
        	_ =>
            {
            	if (task.IsFaulted) wait = task.Exception.Message;
                else wait = task.Result;
                frame.Continue = false;
        	});

        // Timeout if task takes too long
        timer.Enabled = true;
        frame.Continue = true;
        Dispatcher.PushFrame(frame);
        timer.Enabled = false;

        return wait;
    }
}

using System;

public static class Snippet
{
	public static void func(ref Microsoft.Web.WebView2.WinForms.WebView2 webView2, System.String searchQuery)
	{

		//webView2.CoreWebView2.ExecuteScriptAsync("alert('Executing Javascript in Browser')");	

		webView2.CoreWebView2.ExecuteScriptAsync("document.getElementsByName('q')[0].value='" + searchQuery + "'");

		webView2.CoreWebView2.ExecuteScriptAsync("document.getElementsByName('btnK')[0].click()");
	}

}
